import { Card, CardContent, CardMedia, Grid, Typography } from '@mui/material'
import React from 'react'
import log from '../images/log.jpg'

const Test = () => {

    const data = [
        {title:'THE TITLE 1', description:'This is the description 1'},
        {title:'THE TITLE 2', description:'This is the description 2'},
        {title:'THE TITLE 3', description:'This is the description 3'},
        {title:'THE TITLE 4', description:'This is the description 4'}
    ]
  return (
    <Grid container spacing={4} sx={{p:'70px'}}>
        {data.map((data, index) =>(
            <Grid item key={index} md={3} xs={12}>
                <Card sx={{}}>
                    <CardMedia component="img"
                    image={log}
                    alt="logo"
                    sx={{ height: '100px',}}>    
                    </CardMedia>
                    <CardContent>
                        <Typography align='center'>
                            {data.title}
                        </Typography>
                        <Typography align='center'>
                            {data.description}
                        </Typography>
                    </CardContent>
                </Card>
            </Grid>
        ))}



    </Grid>
  )
}

export default Test
